import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import {Nav, Navbar} from 'react-bootstrap'

export default class Navigation extends Component {
  render() {
    return (
      <Navbar expand="lg" bg="light" fixed="top">
        <Navbar.Brand><Link to="/home">Alex Do</Link></Navbar.Brand>
          <Nav className="mr-right">
            <Nav.Link><Link to="/AboutMe.js">About Me</Link></Nav.Link>
            <Nav.Link><Link to="/Software.js">Software</Link></Nav.Link>
            <Nav.Link>Hardware</Nav.Link>
            <Nav.Link>Music</Nav.Link>
            <Nav.Link>Photography</Nav.Link>
            <Nav.Link>Blog</Nav.Link>
            <Nav.Link>Contact</Nav.Link>
          </Nav>
      </Navbar>

    );
  }
}
